import * as S from '../styles/MainStyle';
import { useAppSelector } from 'redux/reducer/hooks';
import sickNmMap from 'utils/searchUtils';
function SearchRec() {
  const { searchData } = useAppSelector(state => state.searchData);
  console.log(searchData);

  return (
    <S.SearchRecLayout>
      <S.RecentWords> 최근 검색어 </S.RecentWords>
      <p>
        {' '}
        <sickNmMap data={searchData} />{' '}
      </p>
    </S.SearchRecLayout>
  );
}

export default SearchRec;
